@R4nd4hl Løsningen må være at finde ud af hvor store #sejlskibe man praktisk kan lave og bruge.
Det meste sendes jo i containere, så at nøjes med mindre skibe er IKKE noget problem, for så vidt at de sejler på #vindkraft. 
#dkpol #Mærsk #dkmedier #Klimakrise

@regeringDK vidste tidligt fredag morgen, at Forsvaret stod over for en af de største akutte operationer i årevis. Alligevel tog forsvarsminister @Trinebramsen til koncert fredag aften og mødtes med en lokal S-forening søndag formiddag.
#dkpol #dkmedier

